import React from 'react'
import { Button, Stack, Typography } from "@mui/material";
import {Box} from '@mui/material';
const Connect = () => {
  return (
    <Box display='flex'
    justifyContent='center'
    alignItems='center'
    minHeight='100vh'>
      <Button variant='contained' color='primary'>CONNECT</Button>
    </Box>
  )
}

export default Connect
